import React from 'react';

import Chat from './components/Chat';
import Join from './components/Join';

import { Provider, BrowserRouter, Route, Switch } from "react-router-dom";

const App = () => {
  return (
    <Provider>
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Join} />
        <Route path="/chat" component={Chat} />
      </Switch>
    </BrowserRouter>
    </Provider>
  );
}

export default App;
